INSERT INTO `v1_d480346736d525def06082471161a245fa0c0eac5d18d47e1d74bccb9b339a6e` VALUES (34314071, 0.5, 1, 1, "ついにこの日がやってきたの～！\n今日はミヤコの誕生日なんだから、\n山のようにプリンを用意して、\n盛大にお祝いするの～♪", 11, 34314, 100711, 0, 10, 0);
